import SearchBarContainer from "./SearchBarContainer";
import NavigationBar from "./NavigationBar";
import Grid from '@material-ui/core/Grid';
import "./core.css";
import Container from '@material-ui/core/Container';
import "./StartingPage.css";




function StartingPage() {
    return (
      <div>
        <NavigationBar />
        <Container className="startingPageMiddle" className="startingPageMiddle">
          <SearchBarContainer />
        </Container>
        <Container name="startingPageEnd" justify="flex-end">
          <Grid container justify="flex-end" direction="column">
          <Grid item>
          <p>&#169; Copyright {new Date().getUTCFullYear()} Fly-AI</p>
          </Grid>
          </Grid>
        </Container>

      </div>
    );
  }

  export default StartingPage;
